import React from "react";
import { Link } from "react-router-dom";
import homeSVG from '../svg/home.svg'

const Navbar = () => {
  return (
    <div>
      <nav>
        <ul className="flex justify-between items-center mb-10 list-none">
          <li>
            <Link to="/">
              <img src={homeSVG} alt="Home SVG" />
            </Link>
          </li>
          <div className="flex gap-6">
            <li>
              <Link to="/generate-recipe">Generate Recipe</Link>
            </li>
            <li>
              <Link to="/view-recipes">View Recipes</Link>
            </li>
          </div>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
